const initialState = {
  fecha: '1969-01-12',
  bid: 700.00,
  ask: 700.30,
  ops: [
    {numop: 1, cliente: 'Santander', fxrate: 'USDCLP', cv: 'Compra', monto: 1000000, precio: 700},
    {numop: 2, cliente: 'Estado', fxrate: 'USDCLP', cv: 'Venta', monto: 2000000, precio: 701},
  ],
  nextNumop: 3,

}

const update = (state = initialState, action) => {
  if (action.type === 'PUNTA') {
    return {...state, bid: action.bid, ask: action.ask}
  }
  return state
}

export default update
